A manhã deste sábado (27/07) foi de título para o Celeiro de Ases. Após bater o Athletico Paranaense pelo placar de 4 a 0 na decisão, a categoria sub-15 do Clube do Povo se sagrou campeã da Copa Vitor Isaías. A partida, iniciada às 9h, aconteceu no estádio do Guarani, em Palhoça-SC.

Ariel Lanzini, comandante colorado, mandou o Inter a campo com Henrique (Mickael), Leandro Lira, Luiz Guilherme, João Croti (Gabriel) e Thauan Lara (Índio); Lukayan (Júnior), Samuel e Robert (Daniel); Varjão, Gustavo Bagatini e Adriel (Arthur). Ofensivo desde os primeiros movimentos, o Clube do Povo abriu o placar antes dos 10 minutos com Bagatini, em bonito chute que contou com ajuda do montinho artilheiro para enganar o goleiro adversário. O segundo veio aos 14, com Lukayan, deslocando o arqueiro em precisa finalização da entrada da área. Ainda antes do intervalo, Gustavo marcou mais um, o terceiro colorado, garantindo importante vantagem para os vestiários. Aos sete da etapa final, Varjão, em uma verdadeira pintura, deu números finais à partida.

O torneio foi nomeado em homenagem ao garoto Vitor Isaías, de 15 anos, natural de Florianópolis, uma das vítimas do incêndio nos alojamentos do Flamengo em fevereiro. Integrante do grupo C, o Inter conquistou o título de maneira invicta, com cinco vitórias e somente um empate, na estreia. Confira a campanha colorada: 
1ª fase
22/07 - Inter 0 x 0 São José
23/07 - Caxias 0 x 6 Inter
24/07 - Inter 2 x 1 Paraná
Quartas de final
25/07 - Inter 4 x 3 PSTC
Semifinais
26/07 - Inter 2 x 0 Paraná
Final
27/07 - Inter 4 x 0 Athletico-PR.
Parabéns pela conquista, gurizada! Conheça o grupo campeão:
