Inter promove I Seminário de Integração da Torcida Colorada

O Sport Club Internacional realizou na noite desta segunda-feira (17/7), no Salão de Atos do Conselho Deliberativo, o I Seminário de Integração da Torcida Colorada. Por iniciativa da Vice-presidência de relacionamento social e do departamento de torcidas e ambiente de jogo, em parceria com a Promotoria do Torcedor (MP), com o Juizado do Torcedor e com a Brigada Militar, o evento debateu os caminhos para que o Beira-Rio se consolide como um estádio de ambiente pacífico, seguro e festivo.

O encontro aproximou os diferentes personagens que participam ativamente da rotina dos jogos no Gigante, seja fazendo a festa na arquibancada ou trabalhando nos bastidores, nas diversas áreas e funções necessárias para que o espetáculo fora de campo ocorra com tranquilidade. O Clube promoveu um diálogo franco entre integrantes de torcidas organizadas, autoridades de segurança pública, dirigentes, integrantes do Conselho Deliberativo, sócios e funcionários do Clube, no qual foram compartilhadas informações com o inutito de propor ações positivas em prol da paz no estádio. Imprensa e representantes do Grêmio também acompanharam o debate.. Parceiros 
